package T483_FindAllAnagramsInAString;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Solution {
	
    public List<Integer> findAnagrams(String s, String p) {
        
    	if(s.length() < p.length()) return null;
    	
    	List ls = new ArrayList();
    	Map map = new HashMap();
    	for(int i = 0 ; i < p.length() ; i ++){
    		if(map.get(p.charAt(i)) ==null )
    			map.put(p.charAt(i), 1);
    		else{
    			int val = (Integer) map.get(p.charAt(i));
    			map.put(p.charAt(i), ++val);
    		}
    			
    	}
    	
    	
    	Map temp = new HashMap();
    	for(int i = 0 ; i < s.length() ; i++){
    		temp.putAll(map);
    		//如果map里面含有单个字符，有可能是包含的
    		//往后以此判断是否有值；
    		
    		if(temp.containsKey(s.charAt(i))){
    			
    			int j;
    			for(j = i ; j < i+p.length() && i+p.length()<=s.length() ; j++){
    				if( temp.get(s.charAt(j))!=null  ){
    					int val = (Integer) temp.get(s.charAt(j));
    					if(val>0)
    						temp.put(s.charAt(j), --val);
    					else
    						break;
    				}else
    					break;
    			}
    			if(j>=i+p.length()){
    				
    				ls.add(i);
    			
    			}
    		}
    		
    	}
    	
    	
    	return ls;
    }
	
	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Solution s = new Solution();
		s.findAnagrams("",
				"");
	}

}
